// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.7.6;
pragma abicoder v2;

import "hardhat/console.sol";

import "@uniswap/v3-core/contracts/interfaces/callback/IUniswapV3FlashCallback.sol";
import "@uniswap/v3-core/contracts/libraries/LowGasSafeMath.sol";
import "@uniswap/v3-periphery/contracts/base/PeripheryPayments.sol";
import "@uniswap/v3-periphery/contracts/base/PeripheryImmutableState.sol";
import "@uniswap/v3-periphery/contracts/libraries/PoolAddress.sol";
import "@uniswap/v3-periphery/contracts/libraries/CallbackValidation.sol";
import "@uniswap/v3-periphery/contracts/libraries/TransferHelper.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";

import {KyberNetworkProxy as IKyberNetworkProxy} from "../interfaces/exchanges/kyber/KyberNetworkProxy.sol";
import {DodoNetworkProxy as IDodoNetworkProxy, IDODOV2} from "../interfaces/exchanges/dodo/DodoNetworkProxy.sol";
import {DodoVendingMachineFactory, DodoPrivatePoolFactory, DodoStablePoolFactory} from "../interfaces/exchanges/dodo/DodoFactory.sol";
import {CurveAddressProvider} from "../interfaces/exchanges/curve/CurveAddressProvider.sol";
import {CurveNetworkProxy as ICurveNetworkProxy} from "../interfaces/exchanges/curve/CurveNetworkProxy.sol";
import {SushiNetworkProxy as ISushiNetworkProxy, SushiFactory as ISushiFactory, SushiPair as ISushiPair} from "../interfaces/exchanges/sushi/SushiNetworkProxy.sol";
import {ContractRegistry as IContractRegistry, BancorNetwork as IBancorNetwork} from "../interfaces/exchanges/bancor/BancorNetworkProxy.sol";
import {ReserveToken as IReserveToken} from "../interfaces/exchanges/bancor/IReserveToken.sol";
import "../Base.sol";

/// @title A Cryptocurrency Arbitrage Contract
/// @author AltaFin
/// @notice This contract can be used for Uniswap V3, Sushiswap, Dodo V2, Kyber, Curve, and Bancor V2.
/// @dev
contract Divergence is
    IUniswapV3FlashCallback,
    PeripheryImmutableState,
    PeripheryPayments,
    Base
{
    using LowGasSafeMath for uint256;
    using LowGasSafeMath for int256;

    ISwapRouter public immutable swapRouter = ISwapRouter(0xE592427A0AEce92De3Edee1F18E0157C05861564);
    IKyberNetworkProxy kyber = IKyberNetworkProxy(0x818E6FECD516Ecc3849DAf6845e3EC868087B755);
    address internal WETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;
    IDodoNetworkProxy dodo = IDodoNetworkProxy(0xa356867fDCEa8e71AEaF87805808803806231FdC);
    DodoVendingMachineFactory dodoVM = DodoVendingMachineFactory(
            0x72d220cE168C4f361dD4deE5D826a01AD8598f6C
        );
    DodoPrivatePoolFactory dodoPP = DodoPrivatePoolFactory(
            0x6B4Fa0bc61Eddc928e0Df9c7f01e407BfcD3e5EF
        );
    DodoStablePoolFactory dodoSP = DodoStablePoolFactory(
            0x6fdDB76c93299D985f4d3FC7ac468F9A168577A4
        );
    ISushiNetworkProxy sushi = ISushiNetworkProxy(0xd9e1cE17f2641f24aE83637ab66a2cca9C378B9F);
    ISushiFactory sushiFactory = ISushiFactory(
            0xC0AEe478e3658e2610c5F7A4A2E1777cE9e4f2Ac
        );
    ISushiNetworkProxy uniswapV2 = ISushiNetworkProxy(0xf164fC0Ec4E93095b804a4795bBe1e041497b92a);
    ISushiFactory uniswapFactory = ISushiFactory(0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f);
    CurveAddressProvider provider = CurveAddressProvider(
            0x0000000022D53366457F9d5E68Ec105046FC4383
        );
    ICurveNetworkProxy curve = ICurveNetworkProxy(provider.get_address(2));
    IContractRegistry bancorContractRegistry = IContractRegistry(0x52Ae12ABe5D8BD778BD5397F99cA900624CfADD4);
    IBancorNetwork bancor = IBancorNetwork(bancorContractRegistry.addressOf("BancorNetwork"));


    constructor()
        PeripheryImmutableState(
            0x1F98431c8aD98523631AE4a59f267346ea31F984,
            0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2
        )
    {}

    struct FlashCallbackData {
        uint256 amount0;
        uint256 amount1;
        address target;
        address payer;
        PoolAddress.PoolKey poolKey;
        uint24 poolFee2;
        address exchange0;
        address exchange1;
        uint256 slippage;
    }

    /// @notice Requires 50 AFN sent to contract to call, then initializes a flash swap on Uniswap
    function initFlash(
        address token0,
        address token1,
        uint256 amount0,
        address exchange0,
        address exchange1,
        uint256 slippage
    ) external {
        PoolAddress.PoolKey memory poolKey = PoolAddress.PoolKey({
            token0: token0,
            token1: address(0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48), //USDC
            fee: 500
        });
        IUniswapV3Pool pool = IUniswapV3Pool(
            PoolAddress.computeAddress(factory, poolKey)
        );

        pool.flash(
            address(this),
            amount0,
            0,
            abi.encode(
                FlashCallbackData({
                    amount0: amount0,
                    amount1: 0,
                    target: token1, // needed?
                    payer: msg.sender,
                    poolKey: poolKey,
                    poolFee2: 500, //poolFee3?
                    exchange0: exchange0,
                    exchange1: exchange1,
                    slippage: slippage
                })
            )
        );
    }

    function uniswapV3FlashCallback(
        uint256 fee0,
        uint256 fee1,
        bytes calldata data
    ) external override {
        FlashCallbackData memory decoded = abi.decode(
            data,
            (FlashCallbackData)
        );
        CallbackValidation.verifyCallback(factory, decoded.poolKey);

        address token0 = decoded.poolKey.token0;
        address token1 = decoded.poolKey.token1;

        uint256 amountOut0;
        uint256 amountOut1;
        if (decoded.exchange0 == 0xE592427A0AEce92De3Edee1F18E0157C05861564) {
            amountOut0 = swapOnUniswapV3(
                decoded.amount0,
                token0,
                decoded.target,
                decoded.poolFee2
            );
        } else if (
            decoded.exchange0 == 0xd9e1cE17f2641f24aE83637ab66a2cca9C378B9F
        ) {
            amountOut0 = swapOnSushi(
                decoded.amount0,
                token0,
                decoded.target,
                decoded.slippage
            );
        } else if (
            decoded.exchange0 == 0xf164fC0Ec4E93095b804a4795bBe1e041497b92a
        ) {
            amountOut0 = swapOnUniswapV2(
                decoded.amount0,
                token0,
                decoded.target,
                decoded.slippage
            );
        } else if (
            decoded.exchange0 == 0x818E6FECD516Ecc3849DAf6845e3EC868087B755
        ) {
            amountOut0 = swapOnKyber(decoded.amount0, token0, decoded.target, decoded.slippage);
        } else if (
            decoded.exchange0 == 0xa356867fDCEa8e71AEaF87805808803806231FdC
        ) {
            amountOut0 = swapOnDodo(decoded.amount0, token0, decoded.target, decoded.slippage);
        } else if (
            decoded.exchange0 == 0x0000000022D53366457F9d5E68Ec105046FC4383
        ) {
            amountOut0 = swapOnCurve(
                decoded.amount0,
                token0,
                decoded.target,
                decoded.slippage
            );
        } else if (
            decoded.exchange0 == 0x52Ae12ABe5D8BD778BD5397F99cA900624CfADD4 // Bancor
        ) {
            amountOut0 = swapOnBancor(decoded.amount0, token0, decoded.target, decoded.slippage);
        } else {
            revert("exchange0 not supported");
        }

        if (decoded.exchange1 == 0xE592427A0AEce92De3Edee1F18E0157C05861564) {
            amountOut1 = swapOnUniswapV3(
                amountOut0,
                decoded.target,
                token0,
                decoded.poolFee2
            );
        } else if (
            decoded.exchange1 == 0xd9e1cE17f2641f24aE83637ab66a2cca9C378B9F
        ) {
            amountOut1 = swapOnSushi(amountOut0, decoded.target, token0, decoded.slippage);
        } else if (
            decoded.exchange1 == 0xf164fC0Ec4E93095b804a4795bBe1e041497b92a
        ) {
            amountOut1 = swapOnUniswapV2(amountOut0, decoded.target, token0, decoded.slippage);
        } else if (
            decoded.exchange1 == 0x818E6FECD516Ecc3849DAf6845e3EC868087B755
        ) {
            amountOut1 = swapOnKyber(amountOut0, decoded.target, token0, decoded.slippage);
        } else if (
            decoded.exchange1 == 0xa356867fDCEa8e71AEaF87805808803806231FdC
        ) {
            amountOut1 = swapOnDodo(amountOut0, decoded.target, token0, decoded.slippage);
        } else if (
            decoded.exchange1 == 0x0000000022D53366457F9d5E68Ec105046FC4383
        ) {
            amountOut1 = swapOnCurve(amountOut0, decoded.target, token0, decoded.slippage);
        } else if (
            decoded.exchange1 == 0x52Ae12ABe5D8BD778BD5397F99cA900624CfADD4
        ) {
            amountOut1 = swapOnBancor(amountOut0, decoded.target, token0, decoded.slippage);
        } else {
            revert("exchange1 not supported");
        }

        payback(
            decoded.amount0,
            decoded.amount1,
            fee0,
            fee1,
            token0,
            token1,
            amountOut1,
            decoded.payer
        );
    }

    function payback(
        uint256 amount0,
        uint256 amount1,
        uint256 fee0,
        uint256 fee1,
        address token0,
        address token1,
        uint256 finalAmount,
        address payer
    ) internal {
        uint256 amount0Owed = LowGasSafeMath.add(amount0, fee0);
        uint256 amount1Owed = LowGasSafeMath.add(amount1, fee1);

        TransferHelper.safeApprove(token0, address(this), amount0Owed);
        TransferHelper.safeApprove(token1, address(this), amount1Owed);

        if (amount0Owed > 0)
            pay(token0, address(this), msg.sender, amount0Owed);
        if (amount1Owed > 0)
            pay(token1, address(this), msg.sender, amount1Owed);

        if (finalAmount > amount0Owed) {
            uint256 profit1 = LowGasSafeMath.sub(finalAmount, amount0Owed);
            uint256 finalProfit = profit1.mul(97) / 100;
            uint256 divergence = profit1 - finalProfit;
            TransferHelper.safeApprove(token0, address(this), divergence);
            pay(
                token0,
                address(this),
                address(0x4cF7a93F8f334dABF18819DB00bE98ffe5D63f69), // AFN Divergence Wallet Address
                divergence
            );
            TransferHelper.safeApprove(token0, address(this), finalProfit);
            pay(token0, address(this), payer, finalProfit);
        }
    }

    function swapOnUniswapV3(
        uint256 amountIn,
        address inputToken,
        address outputToken,
        uint24 poolFee
    ) internal returns (uint256 amountOut) {
        TransferHelper.safeApprove(inputToken, address(swapRouter), amountIn);

        if (inputToken == WETH || outputToken == WETH) {
            amountOut = swapRouter.exactInputSingle(
                ISwapRouter.ExactInputSingleParams({
                    tokenIn: inputToken,
                    tokenOut: outputToken,
                    fee: poolFee,
                    recipient: address(this),
                    deadline: block.timestamp + 200,
                    amountIn: amountIn,
                    amountOutMinimum: 0,
                    sqrtPriceLimitX96: 0
                })
            );
        } else {
            ISwapRouter.ExactInputParams memory params = ISwapRouter
                .ExactInputParams({
                    path: abi.encodePacked(
                        inputToken,
                        poolFee,
                        WETH,
                        poolFee,
                        outputToken
                    ),
                    recipient: address(this),
                    deadline: block.timestamp + 200,
                    amountIn: amountIn,
                    amountOutMinimum: 0
                });

            amountOut = swapRouter.exactInput(params);
        }
    }

    function swapOnSushi(
        uint256 amountIn,
        address inputToken,
        address outputToken,
        uint256 slippage
    ) internal returns (uint256 amountOutSwap) {
        uint256 deadline = block.timestamp + 60 * 10;
        address pair = sushiFactory.getPair(inputToken, outputToken);
        (uint256 reserveIn, uint256 reserveOut, ) = ISushiPair(pair)
            .getReserves();
        uint256 amountOut = sushi.getAmountOut(amountIn, reserveIn, reserveOut);
        address[] memory path = new address[](2);
        path[0] = inputToken;
        path[1] = outputToken;
        address to = address(this);
        uint256 amountOutMin = calculateSlippage(amountOut, slippage);
        TransferHelper.safeApprove(path[0], address(sushi), amountIn);
        try
            sushi.swapExactTokensForTokens(
                amountIn,
                amountOutMin,
                path,
                to,
                deadline
            )
        returns (uint256[] memory amounts) {
            amountOutSwap = amounts[1];
        } catch {
            revert("sushi function failed");
        }
    }

    function swapOnUniswapV2(
        uint256 amountIn,
        address inputToken,
        address outputToken,
        uint256 slippage
    ) internal returns (uint256 amountOutSwap) {
        uint256 deadline = block.timestamp + 60 * 10;
        address pair = uniswapFactory.getPair(inputToken, outputToken);
        (uint256 reserveIn, uint256 reserveOut, ) = ISushiPair(pair)
            .getReserves();
        uint256 amountOut = uniswapV2.getAmountOut(amountIn, reserveIn, reserveOut);
        address[] memory path = new address[](2);
        path[0] = inputToken;
        path[1] = outputToken;
        address to = address(this);
        uint256 amountOutMin = calculateSlippage(amountOut, slippage);
        TransferHelper.safeApprove(path[0], address(uniswapV2), amountIn);
        try
            uniswapV2.swapExactTokensForTokens(
                amountIn,
                amountOutMin,
                path,
                to,
                deadline
            )
        returns (uint256[] memory amounts) {
            amountOutSwap = amounts[1];
        } catch {
            revert("uniswapV2 function failed");
        }
    }

    function swapOnKyber(
        uint256 amountIn,
        address inputToken,
        address outputToken,
        uint256 slippage
    ) internal returns (uint256 amountOut) {
        (uint256 expectedRate, ) = kyber.getExpectedRate(
            IERC20(inputToken),
            IERC20(outputToken),
            amountIn
        );
        expectedRate = calculateSlippage(expectedRate, slippage);
        TransferHelper.safeApprove(inputToken, address(kyber), amountIn);
        try
            kyber.swapTokenToToken(
                IERC20(inputToken),
                amountIn,
                IERC20(outputToken),
                expectedRate
            )
        returns (uint256 bal) {
            amountOut = bal;
        } catch {
            revert("kyber function failed");
        }
    }

    struct DodoParams {
        address inputToken;
        address outputToken;
        uint256 amountIn;
        uint256 minReturnAmount;
        address[] dodoPairs;
        uint256 directions;
        bool isIncentive;
        uint256 deadline;
    }

    function swapOnDodo(
        uint256 amountIn,
        address inputToken,
        address outputToken,
        uint256 slippage
    ) internal returns (uint256 amountOut) {
        DodoParams memory params;
        params.amountIn = amountIn;
        params.inputToken = inputToken;
        params.outputToken = outputToken;
        (
            address[] memory baseToken0Machines,
            address[] memory baseToken1Machines
        ) = dodoPP.getDODOPoolBidirection(inputToken, outputToken);
        address dodoV2Pool;
        if (baseToken0Machines.length != 0) dodoV2Pool = baseToken0Machines[0];
        else if (baseToken1Machines.length != 0)
            dodoV2Pool = baseToken1Machines[0];
        else revert("Could not find a dodo pool");
        (uint256 receivedQuoteAmount, ) = IDODOV2(dodoV2Pool).querySellBase(
            address(this),
            amountIn
        );
        params.minReturnAmount = calculateSlippage(
            receivedQuoteAmount,
            slippage
        );
        params.dodoPairs = new address[](1); //one-hop
        params.dodoPairs[0] = dodoV2Pool;
        params.directions = 0;
        params.deadline = block.timestamp + 60 * 10;
        address dodoApprove = 0xCB859eA579b28e02B87A1FDE08d087ab9dbE5149;
        _generalApproveMax(inputToken, dodoApprove, amountIn);

        TransferHelper.safeApprove(inputToken, address(dodo), amountIn);
        try
            dodo.dodoSwapV2TokenToToken(
                params.inputToken,
                params.outputToken,
                params.amountIn,
                params.minReturnAmount,
                params.dodoPairs,
                params.directions,
                false,
                params.deadline
            )
        returns (uint256 returnAmount) {
            amountOut = returnAmount;
        } catch {
            revert("dodo function failed");
        }
    }

    function _generalApproveMax(
        address token,
        address to,
        uint256 amount
    ) internal {
        uint256 allowance = IERC20(token).allowance(address(this), to);
        if (allowance < amount) {
            if (allowance > 0) {
                TransferHelper.safeApprove(token, to, 0);
            }
            TransferHelper.safeApprove(token, to, uint256(-1));
        }
    }

    function swapOnCurve(
        uint256 amountIn,
        address inputToken,
        address outputToken,
        uint256 slippage
    ) internal returns (uint256 amountOut) {
        (address pool, uint256 expectedRate) = curve.get_best_rate(
            inputToken,
            outputToken,
            amountIn
        );
        if (pool == address(0)) revert("Could not find a curve pool");
        expectedRate = calculateSlippage(expectedRate, slippage);
        TransferHelper.safeApprove(inputToken, address(curve), amountIn);
        try
            curve.exchange(
                pool,
                inputToken,
                outputToken,
                amountIn,
                expectedRate
            )
        returns (uint256 bal) {
            amountOut = bal;
        } catch {
            revert("curve function failed");
        }
    }

    function swapOnBancor(
        uint256 amountIn,
        address inputToken,
        address outputToken,
        uint256 slippage
    )
        internal
        returns (
            uint256 amountOut
            )
    {
        address[] memory path = bancor.conversionPath(IReserveToken(inputToken), IReserveToken(outputToken));
        if (path[0] == address(0)) revert ("Can't find a path on Bancor");
        TransferHelper.safeApprove(inputToken, address(bancor), amountIn);
        uint256 expectedRate = bancor.rateByPath(path, amountIn);
        expectedRate = calculateSlippage(expectedRate, slippage);
        amountOut = bancor.convertByPath{value: msg.value}(
            path,
            amountIn,
            expectedRate,
            address(this),
            address(this),
            1
        );
    }

    function withdrawToken(
        address token,
        address recipient,
        uint256 value
    ) external onlyOwner noReentrant {
        pay(token, address(this), recipient, value);
    }

    /// @param amount The base amount of token before slippage
    /// @param slippage The slippage amount as an integer (1 = 1%)
    /// @return newAmount The new amount of tokens after calculating slippage
    function calculateSlippage(uint256 amount, uint256 slippage)
        internal
        pure
        returns (uint256 newAmount)
    {
        newAmount = amount.mul(100 - slippage) / 100;
    }
}

